          const cacheData = this.dataCache.get(currentPayload.toString());
          // \u5224\u65AD\u5F53\u7F51\u7EDC\u4F18\u5148\u7684\u7B56\u7565\u4E0B\u9009\u62E9\u4F7F\u7528\u7F13\u5B58
